			var num = 0;

			allcode = ''

				}

				}

				}
				if (emp.topHigh250 < top250Num) {

				htmlStr += td1 + emp.circ_mv + "</td>";
				htmlStr += td1 + emp.topHigh120 + "</td>";
				htmlStr += td1 + emp.topHigh250 + "</td>";
				htmlStr += td1 + emp.koudai + "</td>";
				htmlStr += "</tr>";
			}
			//tbody
			document.getElementById("tBody").innerHTML = htmlStr;
			//span
			document.getElementById("count").innerText = num;
		}
	};
